import React from 'react'
import "../Reviews/Reviews.css";


import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import Rating from "@mui/material/Rating";




const Reviews = () => {

  const [value, setValue] = React.useState(2);

  

  return (
    
    <>
        <div className='rev-main-cont'>
            <div className='rev-topbar'>In Reviews We Trust</div>
            <div className='rev-mainsection'>
                <div className="rev-content">
                    <div className='rev-icon-star'>
                        <AccountCircleIcon/>
                        <Rating name="read-only" value={3} readOnly style={{color:"green"}}/>
                    </div>
                    <div className='rev-cust-cont1'></div>
                    <div className='rev-content1'></div>
                </div>
            </div>
        </div>
    </>
  )
}

export default Reviews
